const Internships = () => {
  return (
    <div style={{ minHeight: '80vh', backgroundColor: '#777', color: '#fff', padding: '2rem', animation: 'fadeIn 1s ease-in' }}>
      <h1 style={{ color: '#ff6600', fontSize: '2.5rem', marginBottom: '1rem', textAlign: 'center', transition: 'color 0.3s ease' }} onMouseEnter={(e) => e.target.style.color = '#e55a00'} onMouseLeave={(e) => e.target.style.color = '#ff6600'}>Internship Experience</h1>
      <div style={{ maxWidth: '800px', margin: '0 auto', backgroundColor: '#555', padding: '2rem', borderRadius: '10px', boxShadow: '0 4px 8px rgba(0,0,0,0.2)', transition: 'transform 0.3s ease' }} onMouseEnter={(e) => e.target.style.transform = 'scale(1.02)'} onMouseLeave={(e) => e.target.style.transform = 'scale(1)'}>
        <h3 style={{ color: '#ff6600' }}>Research Intern, IEEE SPS Summer Mentorship Program 2025</h3>
        <p style={{ color: '#ddd', fontSize: '1.1rem', lineHeight: '1.8' }}>
          Worked under Dr. Mita C. Paunwala on “Deep Learning-Based Brain Tumor Segmentation using Multi-Modal MRI Data.”<br/>
          Validated model on ethically collected MRI data from GMERS Hospital Gotri, confirming strong generalization to real-world clinical scans.<br/>
          Produced calibrated and post-processed segmentation outputs suitable for research and clinical visualization.<br/>
          <a href="#" style={{ color: '#ff6600', textDecoration: 'none', transition: 'color 0.3s ease' }} onMouseEnter={(e) => e.target.style.color = '#e55a00'} onMouseLeave={(e) => e.target.style.color = '#ff6600'}>View Internship Details</a>
        </p>
      </div>
      <style>
        {`
          @keyframes fadeIn {
            from { opacity: 0; transform: translateY(20px); }
            to { opacity: 1; transform: translateY(0); }
          }
        `}
      </style>
    </div>
  );
};

export default Internships;
